import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'; 
const one=()=>{
  return <div> page one </div>;
}
const two=()=> {
  return <div> 
    page two 
    <button>
      click me
    </button>
    </div>;
}
const App=()=> {
  return (
    <div>
      <BrowserRouter>
      <div>
        <Route path="/" exact component={one} />
        <Route path="/pagetwo" component={two} />
      </div>
      </BrowserRouter>
    </div>
  )
}
export default App
